// LoaderReadFile returns the content of the loaded asset
// associated to assetName. If the requested asset does not exist, an error is
// returned.
func LoaderReadFile(assetName string) ([]byte, error) {
	if v, ok := loaderGeneratedAssetMapVarName[assetName]; ok {
		b := bytes.NewBuffer(v)
		r, err := gzip.NewReader(b)
		if err != nil {
			return nil, err
		}
		var raw bytes.Buffer
		io.Copy(&raw, r)
		r.Close()
		return raw.Bytes(), nil
	}

	return nil, fmt.Errorf("asset not found: %s", assetName)
}

// LoaderFileNames returns a list of file names of all loaded
// assets.
func LoaderFileNames() []string {
	var newFileNames []string

	for fileName := range loaderGeneratedAssetMapVarName {
		newFileNames = append(newFileNames, fileName)
	}

	return newFileNames
}
